you can just do `return someStatement` or `return bool(someStatement)` if it isn't already a bool.", 'comment_created': datetime.datetime(2021, 6, 28, 21, 0, 58, tzinfo=datetime.timezone.utc), 'commenter': 'lucasmoeskops', 'type': 'User'}, {'comment_id': 660117735, 'comment_body': 'the Ã¹ seems a typo!', 'comment_created': datetime.datetime(2021, 6, 28, 21, 7, 42, tzinfo=datetime.timezone.utc), 'commenter': 'lucasmoeskops', 'type': 'User'}, {'comment_id': 660120016, 'comment_body': 'At some point this might be optimized since when many people watch the live-stream they will essentially all be doing many identical queries to the database all the time. But database caching like django-cachalot will already help out in cases like this I think (only when you have considerably many users). ', 'comment_created': datetime.datetime(2021, 6, 28, 21, 11, 27, tzinfo=datetime.timezone.utc), 'commenter': 'lucasmoeskops', 'type': 'User'}, {'comment_id': 660181078, 'comment_body': "Yes, it's nice. Thanks!", 'comment_created': datetime.datetime(2021, 6, 28, 23, 35, 37, tzinfo=datetime.timezone.utc), 'commenter': 'Tijani-Dia', 'type': 'User'}, {'comment_id': 660181302, 'comment_body': 'Yup, my bad!', 'comment_created': datetime.datetime(2021, 6, 28, 23, 36, 17, tzinfo=datetime.timezone.utc), 'commenter': 'Tijani-Dia', 'type': 'User'}, {'comment_id': 660415294, 'comment_body': 'Alright, do we support it out of the box and define a boolean setting like `WAGTAIL_LIVE_USE_CACHALOT` or shall we just mention in the docs that this optimisation is possible?', 'comment_created': datetime.datetime(2021, 6, 29, 8, 53, 5, tzinfo=datetime.timezone.utc), 'commenter': 'Tijani-Dia', 'type': 'User'}, {'comment_id': 660419639, 'comment_body': 'I think we should just mention this possibility. If people use e.g. cachalot it will be automatically fixed, so no setting is required.', 'comment_created': datetime.datetime(2021, 6, 29, 8, 58, 16, tzinfo=datetime.timezone.utc), 'commenter': 'lucasmoeskops', 'type': 'User'}, {'comment_id': 660421962, 'comment_body': 'GoodðŸ‘', 'comment_created': datetime.datetime(2021, 6, 29, 9, 1, 9, tzinfo=datetime.timezone.utc), 'commenter': 'Tijani-Dia', 'type': 'User'}, {'comment_id': 660549135, 'comment_body': 'I think that this can happen only if `page.latest_revision_created_at` is `None`. And if that happens, we will be in trouble sooner since we call the `timestamp` method on None object [here](https://github.com/wagtail/wagtail-live/blob/35536fb027eec58f425d0a6700979181b6c3ff5a/src/wagtail_live/models.py#L43).  So, we need to handle it from there I think. How do you suggest to handle it?', 'comment_created': datetime.datetime(2021, 6, 29, 12, 4, tzinfo=datetime.timezone.utc), 'commenter': 'Tijani-Dia', 'type': 'User'}, {'comment_id': 660559553, 'comment_body': "Hmm, ok. Maybe we shouldn't worry too much and just return a 400 bad request response to the client if it doesn't include a `last_update_ts ` parameter.", 'comment_created': datetime.datetime(2021, 6, 29, 12, 18, 47, tzinfo=datetime.timezone.utc), 'commenter': 'Stormheg', 'type': 'User'}]
